import "react-native-gesture-handler";
import React, {useState} from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import NewAlarm from "./component/pages/NewAlarm";
import Home from "./component/pages/Home";
import ExistingAlarm from "./component/pages/ExistingAlarm";

import {EditAlarmContext} from './component/context/EditAlarmContext'

const Stack = createStackNavigator();

export default function App() {
  const [editingAlarmData, setEditingAlarmData] = useState(null)

  return (
    <EditAlarmContext.Provider value={editingAlarmData, setEditingAlarmData} >
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen name="Home" component={Home} />
          <Stack.Screen name="NewAlarm" component={NewAlarm} />
          <Stack.Screen name="ExistingAlarm" component={ExistingAlarm} />
        </Stack.Navigator>
      </NavigationContainer>
    </EditAlarmContext.Provider>
  );
}
